import { Card, Col } from 'reactstrap';

class BuffetMenu extends React.Component{
    render(){
        return (
            <Col sm="10">
                addToOrder={this.addToOrder}
                        menuItems={this.state.menuItems}
                        deleteOrder={this.deleteOrder}
                <Card>
                </Card>
            </Col>
          );
    }
};

export default BuffetMenu;
